import axios from 'axios';
import React, { useState, useEffect } from 'react';


function UserHistory() {
  const [data, setData] = useState([]);
  const [email,setEmail]=useState('')
  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    if(userEmail){
      setEmail(userEmail)
    }
  }, []);

  useEffect(()=>{
    if(email){
      fetchData()
    }
  })

  const fetchData = async () => {
      axios.get(`http://localhost:3001/userHistory?email=${email}`)
      .then(response=>{
        console.log(response.data)
        setData(response.data)
      })
      .catch(error=>{
        console.error("Error",error)
      })
  };

  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>Diabetes in Heredity</th>
            <th>Duration of Physical Activity</th>
            <th>Frequency of Fast Food</th>
            <th>Glucose level</th>
            <th>Blood Pressure level</th>
            <th>BMI</th>
            <th>Age</th>
            <th>Prediction</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item, index) => (
            <tr key={index}>
              <td>{item.Heredity === 1 ? 'Yes' : 'No'}</td>
              <td>{item.PhysicalActivity} minutes</td>
              <td>{item.FastFood} </td>
              <td>{item.Glucose} mg/dL</td>
              <td>{item.BloodPressure} mmHg</td>
              <td>{item.BMI} kg/m2</td>
              <td>{item.Age} years</td>
              <td>{item.Outcome} %</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default UserHistory;
